a","1_38720442e153e2c11bbe7c940dc04f8b":"Adicione detalhes para ajudar as pessoas a encontrar esta P\u00e1gina quando fizerem uma pesquisa.","1_bccf9ae24cfa490a9c1ad5cb74055327":"Breve descri\u00e7\u00e3o","1_65d05eaf8dc82eba66786aad64a0406e":"P\u00e1gina exclu\u00edda.","1_830dcc3f7da8c81d96d41dc8a2133c56":"Tirar a P\u00e1gina do ar?","1_a37d9c8d180b0116f8349b39a8b3f877":"Compartilhe seu motivo para tirar a P\u00e1gina do ar. Seus coment\u00e1rios nos ajudar\u00e3o a melhorar as P\u00e1ginas no Facebook.","1_a207493edaa10f7dee9e2886d4c9d5b3":"Quando voc\u00ea tira uma P\u00e1gina do ar, ela n\u00e3o fica vis\u00edvel no Facebook ou na pesquisa. Tem certeza de que deseja tirar esta P\u00e1gina do ar?","1_8559ff05d238ea7fe8115f26db40c1d0":"Tirar do ar","1_1281415119ef5c165277f78a58d4771e":"A P\u00e1gina foi tirada do ar","1_6fb56fff3ac758cfc22b57c95c32e0d9":"Sua P\u00e1gina foi tirada do ar","1_bd5e2325de7e8f712568a9b6842795e7":"Publique novamente sua P\u00e1gina em breve para se conectar com seu p\u00fablico no Facebook.","1_10ef9b307334bfd7cf00fd3651f1fd08":"Pesquisar todos os amigos","1_aceb40ecd999ee5fae24a39d76374d8f":"Nova men\u00e7\u00e3o de P\u00e1gina","1_968870185079214c2135ddf391330898":"Novos compartilhamentos em publica\u00e7\u00f5es da P\u00e1gina","1_ea4ebeb53d5b640da26edc97b0c66997":"Receber um email todas as vezes que houver atividade em sua P\u00e1gina ou uma atualiza\u00e7\u00e3o importante da P\u00e1gina.","1_2ab4858b9719c55e5e5983a09b566929":"Voc\u00ea pode deixar de ver atualiza\u00e7\u00f5es e atividades importantes da P\u00e1gina se desativar todas as notifica\u00e7\u00f5es.","1_4f27a71fe91427af8ba592816eb2f96e":"{name1} convidou voc\u00ea para curtir a P\u00e1gina {page} dele.","1_10c969f942be6ba72f5864bc01a8e936":"Interessado"}},551],["URLFragmentPreludeConfig",[],{"incorporateQuicklingFragment":true,"hashtagRedirect":true},137],["UFIConfig",[],{"commentVPVD":{"debug_console":false,"debug_html":false,"idle_timeout":5000,"locations":["permali